var calculateShippingFee = function(that) {
    let slug = $('select[name="city"]').find("option:selected").data("slug");
    let district = that.find("option:selected").text();
    let postUrl = that.data("url");
    let loyaltyDiscount = $("#loyaltyDiscount").val();
    let loading = '<div class="page-loading"><span>Äang xá»­ lĂ½ ...</span></div>';
    $("body").append(loading);
    $.ajax({
        type: "POST",
        url: postUrl,
        data: {
            slug: slug,
            district: district,
            loyaltyDiscount: loyaltyDiscount,
        },
        dataType: "json",
        success: function(data) {
            $("#cart-subtotal-shipping span:nth-child(2)").text(data.shipping.value);
            $(".cart-summary-totals .cart-total span:nth-child(2)").text(data.total.value);
            $("#shipping-fee").val(data.shipping.amount);
            $(".page-loading").remove()
        },
        error: function(data) {
            $(".page-loading").remove()
        },
    })
};
var getDistrictWard = function() {
    let wardName = $("input.current_ward").val();
    let district = $('select[name="district"]').find("option:selected").data("id");
    let postUrl = $('select[name="ward"]').data("url");
    let loading = '<div class="page-loading"><span>Äang xá»­ lĂ½ ...</span></div>';
    $("body").append(loading);
    $.ajax({
        type: "POST",
        url: postUrl,
        data: {
            district: district,
        },
        dataType: "json",
        success: function(data) {
            $('select[name="ward"]').empty();
            $.each(data, function(i, e) {
                let option = "<option " + (wardName == e.text ? `selected` : ``) + ' data-id="' + e.id + '" value="' + e.text + '">' + e.text + "</option>";
                $('select[name="ward"]').append(option)
            });
            $('select[name="ward"]').select2()
        },
        error: function(data) {
            $(".page-loading").remove()
        },
    })
};
var clearDistrictWard = function() {
    $('select[name="ward"]').empty();
    $(".districtWard").val("")
};
$(document).on("change", 'select[name="city"]', function(e) {
    e.preventDefault;
    clearDistrictWard();
    var cityId = $(this).find("option:selected").data("id");
    var postUrl = $(this).data("url");
    $.ajax({
        type: "POST",
        url: postUrl,
        data: {
            cityId: cityId,
        },
        dataType: "json",
        success: function(data) {
            $('select[name="district"]').empty();
            $.each(data, function(i, e) {
                let option = '<option data-id="' + e.id + '" value="' + e.text + '">' + e.text + "</option>";
                $('select[name="district"]').append(option)
            });
            $('select[name="district"]').select2()
        },
        error: function(data) {
            location.reload()
        },
    })
});
$(document).on("change", 'select[name="district"]', function(e) {
    e.preventDefault;
    calculateShippingFee($(this));
    getDistrictWard()
});
$(document).on("change", 'select[name="ward"]', function(e) {
    let district = $('select[name="district"]').val();
    let ward = $(this).val();
    let wardId = $('select[name="ward"]').select2().find(":selected").data("id");
    if (parseInt(wardId) > 0) {
        $(".districtWard").val(ward + " - " + district)
    } else {
        $(".districtWard").val("")
    }
});
$(document).ready(function() {
    if ($('select[name="district"]').length > 0) {
        calculateShippingFee($('select[name="district"]'));
        getDistrictWard()
    }
});
$(document).ready(function() {
    var $searchWidget = $('#search_widget');
    var $searchBox = $searchWidget.find('input[type=text]');
    var searchURL = $searchWidget.attr('data-search-controller-url');
    var $clearButton = $searchWidget.find('i.clear');
    $.widget('prestashop.psBlockSearchAutocomplete', $.ui.autocomplete, {
        _renderItem: function(ul, product) {
            var image = (product.cover) ? product.cover : prestashop.urls.no_picture_image;
            var $img = $('<img class="autocomplete-thumbnail" src="' + image.bySize.small_default.url + '">');
            return $("<li>").append($("<a>").append($img).append($("<span>").html(product.name).addClass("product"))).appendTo(ul)
        }
    });
    var isMobile = function() {
        return $(window).width() < 768
    };
    var autocompletePosition = function() {
        return {
            my: 'right top',
            at: 'right bottom',
            of: isMobile() ? '.header-top' : '#search_widget',
        }
    };
    $searchBox.psBlockSearchAutocomplete({
        position: autocompletePosition(),
        source: function(query, response) {
            $.post(searchURL, {
                s: query.term,
                resultsPerPage: 10
            }, null, 'json').then(function(resp) {
                response(resp.products)
            }).fail(response)
        },
        select: function(event, ui) {
            var url = ui.item.url;
            window.location.href = url
        },
    }).psBlockSearchAutocomplete("widget").addClass('searchbar-autocomplete');
    $(window).resize(function() {
        $searchBox.psBlockSearchAutocomplete({
            position: autocompletePosition(),
        });
        $searchBox.keyup()
    });
    $clearButton.click(function() {
        $searchBox.val("");
        $clearButton.hide()
    });
    $searchBox.keyup(function() {
        $clearButton.toggle($searchBox.val() !== "" && isMobile())
    })
});
$(document).ready(function() {
    prestashop.blockcart = prestashop.blockcart || {};
    const $body = $("body");
    var showModal = prestashop.blockcart.showModal || function(modal) {
        $body.append(modal);
        $body.one("click", "#blockcart-modal", function(event) {
            if (event.target.id === "blockcart-modal") {
                $(event.target).remove()
            }
        })
    };
    prestashop.on("updateCart", function(event) {
        var refreshURL = $(".blockcart").data("refresh-url");
        var requestData = {};
        if (event && event.resp && event.resp.hasError) {
            let modalHTML = '<div class="modal show" id="cartError" tabindex="-1" role="dialog"><div class="modal-dialog modal-dialog-centered" role="document"><div class="modal-content"><div class="alert alert-danger mb0">';
            modalHTML += '<h4 class="alert-heading text-center">Giá» hĂ ng lá»—i!</h4>';
            for (let i = 0; i < event.resp.errors.length; i++) {
                modalHTML += "<p>" + event.resp.errors[i] + "</p>"
            }
            modalHTML += '<hr><div class="text-center"><button onclick="window.location.reload()" class="btn btn-danger m-auto">XĂ¡c nháº­n</button></div>';
            modalHTML += "</div></div></div></div>";
            $body.append(modalHTML);
            return !1
        }
        if (event && event.reason) {
            requestData = {
                id_product_attribute: event.reason.idProductAttribute,
                id_product: event.reason.idProduct,
                action: event.reason.linkAction,
            }
        }
        $.post(refreshURL, requestData).then(function(resp) {
            $(".blockcart").replaceWith($(resp.preview).find(".blockcart"));
            if (resp.modal) {
                showModal(resp.modal);
                $body.addClass("widget-panel-open")
            }
        }).fail(function(resp) {
            prestashop.emit("handleError", {
                eventType: "updateShoppingCart",
                resp: resp
            })
        })
    })
});
