$(document).on("click", ".jws-qty-plus, .jws-qty-minus", function(e) {
    e.preventDefault();
    var $this = $(this),
        $qty = $this.closest(".quantity").find(".qty"),
        currentVal = parseFloat($qty.val()),
        max = parseFloat($qty.attr("max")),
        min = parseFloat($qty.attr("min")),
        step = $qty.attr("step");
    if (!currentVal || currentVal === "" || currentVal === "NaN") currentVal = 0;
    if (max === "" || max === "NaN") max = "";
    if (min === "" || min === "NaN") min = 0;
    if (step === "any" || step === "" || step === undefined || parseFloat(step) === "NaN") step = 1;
    var postUrl = "";
    if ($this.hasClass("jws-qty-plus")) {
        if (max && (max == currentVal || currentVal > max)) {
            $qty.val(max)
        } else {
            $qty.val(currentVal + parseFloat(step))
        }
        postUrl = $this.parent().find("input").data("up-url")
    } else {
        if (min && (min == currentVal || currentVal < min)) {
            $qty.val(min)
        } else if (currentVal > 0) {
            $qty.val(currentVal - parseFloat(step));
            postUrl = $this.parent().find("input").data("down-url")
        }
    }
    if (postUrl && postUrl != "") {
        $(".jws-page-overlay").addClass("show");
        let query = {
            ajax: 1,
            action: "update",
        };
        $.post(postUrl, query, null, "json").then(function(resp) {
            prestashop.emit("updateCart", {
                resp: resp,
            });
            if ($(".jws-cart-panel-summary .amount").length > 0) {
                $(".jws-cart-panel-summary .amount").text(resp.cart.subtotals.products.value)
            }
        }).fail(function(resp) {
            prestashop.emit("handleError", {
                eventType: "addProductToCart",
                resp: resp
            });
            $(".jws-page-overlay").removeClass("show")
        })
    }
});
