var formatCurrency = function(value) {
    if (typeof value !== "number") {
        return value
    }
    var number = Number(value).toFixed(0).replace(/./g, function(c, i, a) {
        return i > 0 && c !== "," && (a.length - i) % 3 === 0 ? "." + c : c
    });
    number = number + " Ä‘";
    return number
};
